import React, { useState, useEffect } from "react";
import axios from "axios";
import DeviceList from "../DeviceDetails/DeviceList";

function MaaS360Data() {
  const [devices, setDevices] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    axios
      .get("http://localhost:5000/maas360/devices")
      .then((response) => {
        setDevices(response.data);
      })
      .catch((error) => {
        setError(error.message);
      });
  }, []);

  return (
    <div>
      {error ? (
        <p>{error}</p>
      ) : devices ? (
        <div>
          <h1>{devices.device_name}</h1>
          <p>ID: {devices.ID}</p>
          <p>Model: {devices.model}</p>
          <p>Status: {devices.deviceStatus}</p>
          <p>OS: {devices.os}</p>
        </div>
      ) : (
        <p>Loading device...</p>
      )}
    </div>
  );
}

export default MaaS360Data;
